int wav_file_onesec_get_data(size_t offset, size_t length, float *out_ptr) {
    return numpy::int16_to_float(wav_file_onesec + offset, out_ptr, length);
}

int main(int argc, char **argv) {
    for (size_t start_ix = 0; start_ix < 200000 - EI_CLASSIFIER_RAW_SAMPLE_COUNT; start_ix += 4000 /* 250 ms. */) {
        printf("one_sec_standalone %lu - %lu: ", start_ix, start_ix + EI_CLASSIFIER_RAW_SAMPLE_COUNT);

        // copy a second of data in...
        memcpy(wav_file_onesec, wav_file_raw + start_ix, EI_CLASSIFIER_RAW_SAMPLE_COUNT * sizeof(int16_t));

        // and classify
        ei_impulse_result_t result;

        signal_t signal;
        signal.get_data = &wav_file_onesec_get_data;
        signal.total_length = EI_CLASSIFIER_RAW_SAMPLE_COUNT;

        EI_IMPULSE_ERROR res = run_classifier(&signal, &result, false);
        printf("[");
        for (size_t ix = 0; ix < EI_CLASSIFIER_LABEL_COUNT; ix++) {
            printf("%s: %.5f", result.classification[ix].label, result.classification[ix].value);
    #if EI_CLASSIFIER_HAS_ANOMALY == 1
            printf(", ");
    #else
            if (ix != EI_CLASSIFIER_LABEL_COUNT - 1) {
                printf(", ");
            }
    #endif
        }
        printf("]\n");
    }
}
